import React from "react";
import { Typography } from "@mui/material";
import { Divider } from "@mui/material";

export const PriceTaggedItem = ({ title, price }) => {
  return (
    <div>
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "space-between",
          marginInline: 20,
        }}
      >
        <Typography
          component="div"
          variant="h5"
          //style={{ marginBottom: 5 }}
        >
          {title}
        </Typography>
        <Typography
          component="div"
          variant="h5"
          //style={{ marginBottom: 5 }}
        >
          {price}
        </Typography>
      </div>
      <Divider orientation="vertical" variant="middle" flexItem />
    </div>
  );
};
